  JKEMP, Christine Rose and CLAPHAM, Peter Stanley
  JCLAPHAM, Deborah Jane (Debbie) and MYOCEVICH, Shane John
  CLAPHAM, Deborah Jane (Debbie) and MYOCEVICH, Shane John (cont...)
  Shane worked for Carter Holt Harvey for 15 years until the company closed their Kauri Mill in
  1996. He is now Yard Manager with BBS Timber in Whangarei. A keen sportsman, he plays tennis,
  golf and rugby.
  01> MYOCEVICH, Kristen Rose
  b 20.10.1995
  Kristen b. at Whangarei.
  03> CLAPHAM, Terrence Peter and PRICE, Kathleen Joan
  (Terry)
  b 24.07.1974
  b 27.08.1972
  Terrence b. at Whangarei. Kathleen, d/o Graeme Richard Price and Diane Shirley Irving, b. at
  Takapuna. Address: 383 Kamo Road, Whangarei.
  Terry is a fitter and welder, having served his apprenticeship with the New Zealand Refining
  Company at Marsden Point. He now works for South Pacific Instrumentation Ltd. He enjoys
  boating and is a keen fisherman.
  Kathleen moved to Whangarei with her family in 1975. She has been a machinist with Glenside
  Clothing for four years and is now a delicatessen assistant with Woolworths, Kensington, She
  enjoys gardening, sewing and craft work.
  02> KEMP, William Henry (Bill) m on 03.03.1973 to BIRCHALL, Beverley Edna
  b 30.11.1951
  b 29.02.1956
  William b. at Warkworth and m. at Whangarei. Beverley, d/o Dalton Arthur Birchall and Beverley
  Patricia MacDonald, b. at Kawakawa. Address: 17 Frinderstein Way, Karratha 6714, Western Australia.
  Bill served time as a painter and is now working on the North West Shelf Gas Project at Dampier,
  doing sheetmetal work.
  Beverley worked in the grocery trade in New Zealand and in Karratha she worked as a dental nurse
  and a receptionist. She now has a gift shop in Karratha.
  Bill enjoys fishing, boating and gardening and Beverly's interests are gardening, crafts and floral
  arranging.
